function ArrayList(){

    const arrays = [
        {
            id: 1,
            title: 'Hello world',
            text: 'Lorem ipsum dolor'
        },
        {
            id: 2,
            title: 'Hello world',
            text: 'Lorem ipsum dolor'
        }
    ]


    const ArrayMaps = arrays.map(
        (array) => 
        <div key = {array.id} className="element">
            <div className="title">
                <h1>{array.title}</h1>
            </div>
    
            <div className="text">
                <p>{array.text}</p>
            </div>
        </div>
    )
    return(
        <div class = "content">
            {ArrayMaps}
        </div>
    )
}

function Array(){
    return(
        {ArrayList}
    )
}

export default Array
